import React,{Component} from 'react'
import './App.css'
import Navbar from './Navbar';
class App extends Component {
    //리액트 코드 작성
    render(){
        return (
            <div>
                <Navbar/>
                <div className='text-center'>
                    <h></h>
                </div>
            </div>
        )    
    }
}

export default App;
